const API_URL = process.env.API_URL

export const getUsers = async () => {
    fetch(`${API_URL}/api/users/`, {
        method: "POST",
        headers: {
            "Content-Type": "application/json",
        },
        body: JSON.stringify(data),
    })
    .then((res) => res.json())
    .then((data) => console.log(data));
}
